import { createRouter, createWebHistory } from 'vue-router'; // createRouter와 createWebHistory 임포트
import Chart from '@/components/Chart/Chart.vue';
import InsertForm from '@/components/Insert/InsertForm.vue';

const router = createRouter({
    history: createWebHistory(),
    routes: [
      { 
        path: "/",
        name:"Main2",
        component: Main
      },
      {
        path: "/Catchvegan/member/aftermember",
        name: "Aftermember",
        component: Aftermember,
      },
      {
        path: "/Catchvegan/manager/aftermanager",
        name: "Aftermanager",
        component: Aftermanager,
      },
      {
        path: "/Catchvegan",
        name: "Main",
        component: Main,
      },
      {
        path: "/Catchvegan/error",
        name: "Error",
        component: Error,
      },
      {
        path: "/Catchvegan/restaurant/detail/:restaurantIdx",
        name: "Detail",
        component: Detail,
      },
      {
        path: "/Catchvegan/reserve/:restaurantIdx",
        name: "Reserve",
        component: Reserve,
      },
      {
        path: "/Catchvegan/member/findMyId",
        name: "FindMyId",
        component: FindMyId,
      },
      {
        path: "/Catchvegan/member/findMyPassword",
        name: "FindMyPassword",
        component: FindMyPassword,
      },
      {
        path: "/Catchvegan/member/signup",
        name: "Signup",
        component: Signup,
      },
      {
        path: "/Catchvegan/restaurant/search",
        name: "Search",
        component: Search,
      },
      {
        path: "/Catchvegan/member/my-dining",
        name: "Mydining",
        component: Mydining,
      },
      {
        path: "/Catchvegan/member/login",
        name: "Login",
        component: Login,
      },
      {
        path: "/Catchvegan/member/mypage",
        name: "Mypage",
        component: Mypage,
      },
      {
        path: "/Catchvegan/review/:visitIdx",
        name: "Reviewinsert",
        component: Reviewinsert,
      },
      {
        path: "/Catchvegan/manager/:managerIdx",
        name: "Manager",
        component: Manager,
      },
      {
        path: "/Catchvegan/reserve",
        name: "Reservee",
        component: Reserve,
      },
      {
        path: "/Catchvegan/reserve/confirm",
        name: "Confirm",
        component: Confirm,
      },
    ],
  });
  
  export default router;
